import React from "react";
import { Link } from "react-router-dom";

const Priceprops = () => {
  return (
    <>
      <div className="price-inner-child">
            <div className="price-child">
                <div className="text">
                    <h2>
                        standard
                    </h2>
                    <span>
                        $59
                    </span>
                    <Link to="#">choose</Link>
                </div>
            </div>
            <div className="price-child">

            </div>
      </div>
    </>
  );
};

export default Priceprops;
